import React from "react";
import SHOP_DATA from "../../ShopList";
import PreviewComponent from "../../components/PreviewComponent/PreviewComponent";
import { selectShopCollections } from "../../redux/shop/shop-selectors";
import { connect } from "react-redux";
import { createStructuredSelector } from "reselect";
class ShopPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      components: SHOP_DATA,
    };
  }

  render() {
    const { components } = this.state;
    return (
      <div className="shop-page">
        {components.map(({ id, ...othercomponentprops }) => (
          <PreviewComponent key={id} {...othercomponentprops} />
        ))}
      </div>
    );
  }
}

const mapStateToProps = createStructuredSelector({
  collections: selectShopCollections,
});

export default connect(mapStateToProps)(ShopPage);
